### 3.3. Multimodal Alignment

Cross-modality Alignment. As depicted in Figure 1b, symmetric contrastive learning (SCL) loss was employed to align image embeddings with gene embeddings. Specifically, for a batch of $M$ paired pathology image-gene expression samples $\left\{\left(\mathbf{h}_{i}, \mathbf{g}_{i}\right)\right\}_{i=1}^{M}$, where $\mathbf{h}_{i}$ and $\mathbf{g}_{i}$ denote the $i$-th image and gene embedding obtained from the encoders, the loss
function is defined as:

$$
\begin{aligned}
\mathcal{L}_{S C L}= & -\frac{1}{2 M} \sum_{i=1}^{M} \log \frac{\exp \left(\tau \mathbf{h}_{i}^{T} \mathbf{g}_{i}\right)}{\sum_{j=1}^{M} \exp \left(\tau \mathbf{h}_{i}^{T} \mathbf{g}_{j}\right)} \\
& -\frac{1}{2 M} \sum_{n=1}^{M} \log \frac{\exp \left(\tau \mathbf{g}_{n}^{T} \mathbf{h}_{n}\right)}{\sum_{m=1}^{M} \exp \left(\tau \mathbf{g}_{n}^{T} \mathbf{h}_{m}\right)}
\end{aligned}
$$

where $\tau$ is the temperature parameter. The first term represents image-to-gene loss, and the second represents gene-toimage loss. The loss function $\mathcal{L}_{S C L}$ aims to minimize the distance between paired embeddings while maximizing the distance between unpaired embeddings.
Other Optimization Strategy. Unlike qualitative text, gene expression is quantitative, prompting us to consider a regression approach for aligning the encoders across modalities. As a complement to the primary method, a reconstruction loss (mean squared error) is introduced, termed UMPiRE-REC:

$$
\mathcal{L}_{R E C}=\frac{1}{M} \sum_{i=1}^{M}\left\|\mathbf{e p}_{i}^{h c g}-M L P\left(\mathbf{h}_{i}\right)\right\|_{2}
$$

where $\mathbf{e p}_{i}^{h c g}$ represents the normalized top 1500 highly variable gene expression and $\mathbf{h}_{i}$ denotes the image embedding. Additionally, we employed various contrastive learning loss and L1 loss for ablation studies (in Section 4.4).
